import React from 'react'


let color = '#'
let str = '0123456789abcdef'
  for (let i = 0; i < 6; i++) {
    let index = Math.floor(Math.random() * str.length)
    color += str[index]
  }

function RandomColor() {
  return (
    <div>
      <h2 style={{backgroundColor:color}}>{color}</h2>
    </div>
  )
}

export default RandomColor
